import './App.css';
import Cell from './components/Сell/Сell'
import Line from './components/Line/Line';

function App() {
  let arrLine = []
  let arrCell: any = []
  let arrBool: any = []

  for (let i = 0; i < 8; i++) {
    arrLine.push(i)
    arrCell.push(i)
    for (let j = 0; j < 8; j++) {
      if ((i + j) % 2 ==0) {
        arrBool.push(false)
      }else {
        arrBool.push(false)
      }
    }
  }

  // console.log(arrCell)

  return (
    <div className="App">
      {arrLine.map((el) => (
        <div className='Line'>
          {el}
          {arrCell.map((e: any) => (
            <div className={arrBool[e] ? 'Cell__white': 'Cell__black'}></div>
          ))}
        </div>
      ))}
    </div>
  );
}

export default App;
